import logo from './logo.svg';
import NavBar from './combine/NavBar.js';
import SignUp from './combine/FullPages/SignUp';
import SignIn from './combine/FullPages/SignIn';
import Price from './combine/FullPages/Price';
import Footer from './combine/Footer';

function App() {
  return (

   <> 
      <Router>

      <NavBar/>
        <Switch>

          <Route path='/pricing' component={Price} />


          <Route path='/sign-up' component={SignUp} />
          <Route path='/sign-in' component={SignIn} />
        </Switch>
        <Footer/>
      </Router>

    </>
  );
}

export default App;
